window.bookSummaryJSON = "<p>We were the kids of addicts, discarded and forgotten about by the people who were supposed to love us the most. But together we found family and created our own solace. I never thought I would be alone because I had them. Until one night changed everything.</p> <p>The world knows them as Satan and Blaze. The masked lead singer and drummer of international rock sensation Gutless Void.</p> <p>I know them as Lars Morgan and Cain Foster. The two boys I loved who broke my heart.</p> <p>*Rudimentary Distortion is high heat. This book is only meant for seasoned spice listeners.*</p>"; 
